	btn			= ButtonField default null;
	topf		= FrameForm default null;
	i			= integer not null;
	j			= integer not null;
enddeclare
{
	topf = curframe.TopForm;
}


on click gobtn =
{
	fields = topf.FieldsByProperty(
		tagname='rounding', searchset=topf.Children);
	rounder = fields[1];

	fields = topf.FieldsByProperty(
		tagname='independent rounding', searchset=topf.Children);
	indrounder = fields[1];

	/*
	**	Display the rounding
	*/
	for i = 1 to rounder.ChildFields.LastRow do
		strip = rounder.ChildFields[i];
		for j = 1 to strip.ChildFields.LastRow do
			btn = strip.ChildFields[j];
			/*
			**	Increase the rounding, field by field
			*/
			btn.UpdBackground(cornersize=4**(j)-1);
		endfor;
	endfor;

	/*
	**	Display independent rounding
	*/
	for i = 1 to indrounder.ChildFields.LastRow do
		strip = indrounder.ChildFields[i];
		btn = strip.ChildFields[1];
		$INFO(varchar(i) + '::' + varchar(btn.AbsYTop));
		case i of
		1:	btn.UpdBackground(cornersize=25*($TL) + 0*($TR) + 0*($BR) + 1*($BL));
		2:	btn.UpdBackground(cornersize=25*($TL) + 0*($TR) + 0*($BR) + 25*($BL));
